import Avatar from "./Avatar";

const SupportEngine = () => {
    const [visible, setVisible] = useState(false);
    return (
        <div>
            <Avatar 
                style={{ 
                    position: 'fixed', 
                    bottom: '24px', 
                    right: '24px ' 
                }} 
            />
        </div>
    )
}

export default SupportEngine;
